    import React from 'react';
    import Proptypes from 'prop-types';
    import Head from 'next/head'
    const NodeBird = () => {
        return (
            <div>
                <Head>
                    <meta charSet="urf-8"/>
                    <title>NodeBird</title>
                    <Component/>
                </Head>
            </div>
        )
    }
    NodeBird.proptypes = {
        Component :Proptypes.elementType.isRequired
    }

    export default NodeBird
